import Navbar from "./components/Navbar";
import Clicky from "./components/Clicky";

const App = () => {

    let exampleProp = "example navbar prop";

    return (
        <>
            <Navbar example={exampleProp} />
            <h1>Hello from App</h1>
        </>
    );
};

export default App;
